  false,\n\t\"url\": null,\n\t\"notes\": \"This annual narrative report for Rice Lake
  (including the Sandstone Unit) and Mille Lacs National Wildlife Refuges outlines
  Refuge accomplishments during the 2004 fiscal year. The report begins with an introduction
  to the Refuge. Highlights and weather conditions are summarized for the year. Information
  about monitoring and studies- including surveys and censuses and studies and investigations-
  is provided next. Habitat restoration and management projects are also covered;
  activities include water level management and prescribed burning. Fish and wildlife
  management are discussed next with emphasis on disease monitoring, reintroductions,
  and nest structures. Coordination activities, such as interagency coordination,
  tribal coordination, private land activities, and cooperative activities, are outlined.
  The resource protection section provides an update on law enforcement, wildfire
  preparedness, permits, contaminant investigation, cultural resource management,
  and land acquisition support. Information about public education and recreation
  is given including visitor services and outreach. Finally, comprehensive management
  planning is discussed in the Refuge planning and administration section. Refuge
  brochures and field guides are attached.\",\n\t\"license_title\": \"License Not
